// src/curry/chain/index.ts
function chain(...funcs) {
  return (...args) => {
    return funcs.slice(1).reduce((acc, fn) => fn(acc), funcs[0](...args));
  };
}

// src/curry/compose/index.ts
function compose(...fn) {
  return fn.reverse().reduce((acc, _fn) => _fn(acc));
}

// src/curry/partial/index.ts
function partial(fn, ...args) {
  return (...rest) => fn(...args, ...rest);
}
export {
  chain,
  compose,
  partial
};
